import { Tooltip } from "@mui/material";
import { useEffect, useState } from "react";
import IpAddress from "../../../../IpAddress";

function Player(props: {playerName: string;}){
    const [playerUUID, setPlayerUUID] = useState<any>();
    const [playerImage, setPlayerImage] = useState<any>();

    useEffect(() => {
        var ip = new IpAddress();
        fetch(`http://${ip.getIP()}:8080/minecraft/player`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({playerName: props.playerName})
        }).then(res => res.json())
        .then(json => {
            setPlayerUUID(json.playerUUID);
            setPlayerImage(json.playerImage);
            {console.log(json)}

        });
    });
    return (
        <div className="playertab">
            <div className="playertab-icon"><img src={playerImage} /></div>
            <Tooltip title={playerUUID}>
                <div className="playertab-playername">{props.playerName}</div>
            </Tooltip>
        </div>
    );
}
export default Player;
